export class ProductItem {
  id : number;
	nom : string;
	url : string;
	description : string;
	prix : number;
	disponibilite : boolean;

  constructor(id : number, nom: string, url: string, description: string, prix: number, disponibilite: boolean) {
    this.id = id;
    this.nom = nom;
    this.url = url;
    this.description = description;
    this.prix = prix;
    this.disponibilite = disponibilite;
  }
}
